DROP TABLE IF EXISTS `absent_count`;

CREATE VIEW `absent_count`  AS SELECT count(distinct `employeedetails`.`employee_id`) AS `total` FROM (`employeedetails` left join `attendance` on(`attendance`.`user_id` = `employeedetails`.`employee_id`)) WHERE (`attendance`.`status` = 'absent' OR !exists(select 1 from (`employeedetails` `ed` join `attendance` `a` on(`a`.`user_id` = `ed`.`employee_id`)) where `ed`.`employee_id` = `attendance`.`user_id` AND `a`.`date` = curdate() limit 1)) AND `employeedetails`.`e_status` = 'Active' ;

