--
-- Structure for view `avg_perc`
--
DROP TABLE IF EXISTS `avg_perc`;

CREATE VIEW `avg_perc`  AS SELECT truncate(ifnull(avg(`monthly_attendance`.`absents`),0) / `total_emp`.`total`,2) AS `average` FROM (`monthly_attendance` join `total_emp`) WHERE 1 ;

-- --------------------------------------------------------

--
-- Structure for view `calendar_data`
--
DROP TABLE IF EXISTS `calendar_data`;

CREATE VIEW `calendar_data`  AS SELECT `dates`.`date` AS `date`, ifnull(sum(case when `a`.`status` = 'present' then 1 else 0 end),0) AS `present_count`, `total_emp`.`total`- ifnull(sum(case when `a`.`status` = 'absent' or `a`.`status` = 'on_leave' then 1 else 0 end),0) AS `absents` FROM (((select '2024-01-01' + interval `seq_0_to_365`.`seq` day AS `date` from `seq_0_to_365`) `dates` left join `attendance` `a` on(`dates`.`date` = `a`.`date`)) join (select `total_emp`.`total` AS `total` from `total_emp`) `total_emp`) GROUP BY `dates`.`date`, `total_emp`.`total` ORDER BY `dates`.`date` ASC ;

-- --------------------------------------------------------

--
-- Structure for view `count_avg_perc`
--
DROP TABLE IF EXISTS `count_avg_perc`;

CREATE VIEW `count_avg_perc`  AS SELECT truncate(ifnull(avg(`monthly_attendance`.`absents`),0),2) AS `average_absent`, truncate(ifnull(avg(`monthly_attendance`.`present_count`),0),2) AS `average_present` FROM (`monthly_attendance` join `total_emp`) WHERE 1 ;

